import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { TripsProvider } from './context/TripsContext';

ReactDOM.render(
    <TripsProvider>
        <App />
    </TripsProvider>,
    document.getElementById('root')
);
